            await sut.LoadMediaPlaybackInfoAsync(videoId);

            sut.IsTranscoding = isTranscoding;

            var expected = Newtonsoft.Json.JsonConvert.DeserializeObject<MediaPlayerPlayBackInfo>(expectedData);

            // Act
            await sut.GetPlaybackInfo(100d, 100d);

            // Assert
            Assert.IsNotNull(sut.MediaPlayerPlayBackInfo);

            sut.MediaPlayerPlayBackInfo.Should().BeEquivalentTo(expected);

            requestAdapterMock.VerifyAll();
        }

